import React, { useState, useEffect } from 'react';

function App() {
  const [stockData, setStockData] = useState([]);
  const [stockDataKeys, setStockDataKeys] = useState([]);
  console.log(stockData)
  console.log(stockDataKeys)

  useEffect(() => {
    fetch('/api/stock-data')
      .then(response => response.json())
      .then(data => {
        let dkey = Object.keys(data);
        setStockData(data);
        setStockDataKeys(dkey);
      });


  }, []);

  const lastElement = stockDataKeys[stockDataKeys.length-1];
  const percentage = ((stockData[lastElement]["4. close"] - stockData[lastElement]["1. open"])/stockData[lastElement]["1. open"]);

  return (
    <div>


      {stockDataKeys.length > 0 &&

          <p>{percentage}%</p>


      }
